import React from "react";
import './Popup.css'
function ReservationsPopup(props){
    return (props.trigger) ? (
        <div className="popup">
            <div className="inner">
                <button className="close">close</button>
                {props.children}
            </div>

        </div>
    ) : "";
}

export default ReservationsPopup
